import React from "react";
import { Link } from "react-router-dom";
import "./Profile.css";
import { defaultImgs } from "../defaulttimgs";

const Profile = () => {
  return (
    <>
      <div className="pageIdentify">Profile</div>
      <img className="profileBanner" src={defaultImg[1]}></img>
    </>
  );
};

export default Profile;
